import React from 'react';

interface Props {
  battleLog: string[];
}

const BattleLog: React.FC<Props> = ({ battleLog }) => {
  return (
    <div>
      <h3>Battle Log</h3>
      <ul>
        {battleLog.map((entry, index) => (
          <li key={index}>{entry}</li>
        ))}
      </ul>
    </div>
  );
}

export default BattleLog;
